function wakeUp(){for(var e=0;e<lazy.length;e++){var t=lazy[e].getAttribute("data-src");t&&lazy[e].setAttribute("src",t)}}var side_menu_list=document.querySelector("#menu ul.navbar-nav").innerHTML;document.querySelector("#panel ul.navbar-nav").innerHTML=side_menu_list;var slideout=new Slideout({panel:document.getElementById("panel"),menu:document.getElementById("menu"),padding:256,tolerance:70});document.querySelector(".toggle-button").addEventListener("click",function(){slideout.toggle()});var siema=document.getElementsByClassName("siema-container");siema.length&&new Siema({selector:".siema-container",duration:200,easing:"ease-out",perPage:1,startIndex:0,draggable:!0,multipleDrag:!0,threshold:20,loop:!1});var lazy=document.getElementsByClassName("lazy");lazy.length&&(window.onload=wakeUp);